import Card from './Card';
//import styles from './estilos.module.css'; className={styles.estil}

function Cards({characters}) {

   return(
      <div>
         {characters.map((que)=>{
            return <Card
               key={que.id}
               name={que.name}
               species={que.species}
          gender={que.gender}
          image={que.image}
          onClose={() => window.alert('Emulamos que se cierra la card')}
               />

         })

         }
      </div>
   )
}
export default Cards;
